import {StyleSheet} from 'react-native'

const style = StyleSheet.create({
    search:{
        height: 40, 
        borderColor: 'gray', 
        borderWidth: 1,
        marginTop:500,
        margin:10
    },
    name:{
        fontWeight:"bold"
        ,fontSize:20
        ,margin:10
        ,borderBottomColor:"grey"
        ,borderBottomWidth: StyleSheet.hairlineWidth
    },
    DataTitle:{
        fontWeight:"bold"
    },
    accordion:{
        margin:30
        
    },
    firstView:{
        marginTop:60
    }
})

export default style;
